    "category": "section",
    "text": "NLPModels.jl: Defines data structures for nonlinear optimization models. Includes models for user-provided functions, automatic differentiation, JuMP / MathProgBase models, and the abstract models used by CUTEst.jl and AmplNLReader.jl.\nCUTEst.jl: Provides access to the Constrained and Unconstrained Testing Environment with safe threads (CUTEST) repository of problems. Uses NLPModels.jl.\nAmplNLReader.jl: Provides access to AMPL Models. Uses NLPModels.jl.\nOptimizationProblems.jl: Implements several problem in JuMP format. Can be used with NLPModels for easy multiplatform access to problems."
